INSERT INTO `events` (`id`, `title`, `titlekd`, `img`, `sum`, `content`, `created_at`, `updated_at`) VALUES
(1, 'Tặng 50% cho khách hàng trả trước nạp tiền ngày 01/01/2017 ', '', 'events1.jpg', 'Tặng 50% cho khách hàng trả trước nạp tiền ngày 01/01/2017 ', 'Tặng 50% cho khách hàng trả trước nạp tiền ngày 01/01/2017 ', '2017-01-06', '2017-01-06'),
(2, 'Nhận tin ngay – Quà liền tay cùng MobiFone ', '', 'events2.jpg', 'Tin nhắn quảng cáo là một tính năng hữu ích của MobiFone. Khi khách hàng đăng ký nhận tin nhắn sẽ được thông báo tức thời khi MobiFone cập nhật các dịch vụ mới, tính năng mới, chính sách mới hay các khuyến mại hấp dẫn.', 'Tin nhắn quảng cáo là một tính năng hữu ích của MobiFone. Khi khách hàng đăng ký nhận tin nhắn sẽ được thông báo tức thời khi MobiFone cập nhật các dịch vụ mới, tính năng mới, chính sách mới hay các khuyến mại hấp dẫn.', '2017-01-06', '2017-01-06'),
(3, 'Cơ hội nhận hàng nghìn giải thưởng hấp dẫn với CTKM “Giai điệu cuộc sống” ', '', 'events3.jpg', '\r\n\r\nBạn cảm thấy nhẹ nhàng, thư thái khi nghe nhạc?\r\n\r\nBạn khao khát khám phá cảm xúc con người qua âm nhạc?\r\n\r\nHãy tham gia chương trình khuyến mại “Giai điệu cuộc sống” (09/12/2016 đến 08/03/2017) để lắng nghe trái tim qua những ca khúc, nhịp điệu và có cơ hội nhận nhiều giải thưởng giá trị từ chương trình.  \r\n', '\r\n\r\nBạn cảm thấy nhẹ nhàng, thư thái khi nghe nhạc?\r\n\r\nBạn khao khát khám phá cảm xúc con người qua âm nhạc?\r\n\r\nHãy tham gia chương trình khuyến mại “Giai điệu cuộc sống” (09/12/2016 đến 08/03/2017) để lắng nghe trái tim qua những ca khúc, nhịp điệu và có cơ hội nhận nhiều giải thưởng giá trị từ chương trình.  \r\n', '2017-01-06', '2017-01-06');
