(6, 'Tuyển dụng', 'tuyen-dung', 'NB67_baner.png', '<p align=\"center\" style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px; text-align: center;\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\"><strong>THÔNG TIN TUYỂN DỤNG THÁNG 4/2017</strong></span></p><p align=\"right\" style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px; text-align: center;\"><span style=\"color: rgb(255, 51, 51); font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\"><strong><span style=\"color: blue;\" data-mce-mark=\"1\">&nbsp;</span></strong>Hạn nộp Hồ sơ: 30/04/2017 – ƯU TIÊN ỨNG VIÊN NỘP HỒ SƠ SỚM&nbsp;<br></span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"color: rgb(0, 0, 0); font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\">Công ty Cổ phần Máy tính&nbsp;Ngọc&nbsp;Cường&nbsp;là đơn vị hàng đầu trong lĩnh vực bán lẻ sản phẩm Máy tính, linh kiện điện tử. Đề mở rộng hoạt động sản xuất kinh doanh, hiện nay chúng tôi tuyển dụng các vị trí làm việc tại&nbsp;Thai Nguyên&nbsp;như sau:</span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\"><strong><span style=\"color: red;\" data-mce-mark=\"1\">&nbsp;</span></strong></span></p><table align=\"center\" style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px; width: 768px; height: 1759px;\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\"><tbody><tr style=\"height: 21.3pt;\"><td width=\"108\" valign=\"top\" style=\"padding: 2.75pt 2.75pt 2.75pt 2.7pt; width: 81pt; height: 21.3pt;\"><p align=\"center\" class=\"TableContents\" style=\"text-align: center;\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\"><strong><span style=\"color: red;\" data-mce-mark=\"1\">Vị trí tuyển</span></strong></span></p></td><td width=\"294\" valign=\"top\" style=\"padding: 2.75pt 2.75pt 2.75pt 2.7pt; width: 220.45pt; height: 21.3pt;\"><p align=\"center\" class=\"TableContents\" style=\"text-align: center;\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\"><strong><span style=\"color: red;\" data-mce-mark=\"1\">Mô tả công việc</span></strong></span></p></td><td width=\"264\" valign=\"top\" style=\"padding: 2.75pt 2.75pt 2.75pt 2.7pt; width: 2.75in; height: 21.3pt; border: 1pt solid black;\"><p align=\"center\" class=\"TableContents\" style=\"text-align: center;\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\"><strong><span style=\"color: red;\" data-mce-mark=\"1\">Yêu cầu công việc</span></strong></span></p></td></tr><tr><td width=\"108\" valign=\"top\" style=\"padding: 2.75pt 2.75pt 2.75pt 2.7pt; width: 81pt;\"><p align=\"center\" class=\"TableContents\" style=\"text-align: center;\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\"><strong><strong>01 Trưởng Phòng Marketing</strong></strong></span></p><p align=\"center\" class=\"TableContents\" style=\"text-align: center;\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\">&nbsp;</span></p></td><td width=\"294\" valign=\"top\" style=\"padding: 2.75pt 2.75pt 2.75pt 2.7pt; width: 220.45pt;\"><p><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\">&nbsp;* Phát triển khách hàng mục tiêu.</span></p><p><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\">- Tổ chức hệ thống thu thập thông tin và lập hồ s<span lang=\"VI\" data-mce-mark=\"1\">ơ danh sách khách hàng mục tiêu.</span></span></p><p><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\">- Tổ chức quản lý và chăm sóc khách hàng.</span></p><p><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\">- Hỗ trợ và cung cấp thông tin khách hàng cho phòng kinh doanh.&nbsp;</span></p><p><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\">* Nghiên cứu thị tr<span lang=\"VI\" data-mce-mark=\"1\">ường, mở rộng thị trường, phát triển sản phẩm.</span></span></p><p><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\">- Lập kế hoạch nghiên cứu thị tr<span lang=\"VI\" data-mce-mark=\"1\">ường, mở rộng thị trường.</span></span></p><p><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\">- Xây dựng và thực hiện ch<span lang=\"VI\" data-mce-mark=\"1\">ương tr</span>ình marketing.</span></p><p><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\">- Đề xuất các sản phẩm phù hợp với nhu cầu của khách hàng và thị tr<span lang=\"VI\" data-mce-mark=\"1\">ường trong một khoảng thời gian nhất định.</span></span></p><p><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\">* Phát triển th<span lang=\"VI\" data-mce-mark=\"1\">ương hiệu, phát triển sản phẩm của công ty.</span></span></p><p><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\">- Đề xuất cho BGĐ về việc phát triển thương hiệu.</span></p><p><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\">- Hồ trợ cho các bộ phận khác thực hiện theo các ch<span lang=\"VI\" data-mce-mark=\"1\">ương tr</span>ình marketing.</span></p><p><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\">* Thực hiện các ch<span lang=\"VI\" data-mce-mark=\"1\">ương tr</span>ình marketing do ban giám đốc phê duyệt.</span></p><p><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\">- Chủ động xây dựng kế hoạch marketing ngắn hạn, trung hạn, dài hạn.</span></p><p><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\">- Tổ chức thực hiện ch<span lang=\"VI\" data-mce-mark=\"1\">ương tr</span>ình marketing.</span></p><p><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\">- Theo dõi, điều chỉnh, báo cáo tình hình thực hiện.</span></p><p><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\">* Kiểm soát công việc của nhân viên bộ phận mình, đề xuất khen thưởng, kỷ luật nhân viện thuộc bộ phận.</span></p><p><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\">- Giao việc cho nhân viên thuộc phạm vi quản lý</span></p><p><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\">- Kiểm tra giám sát nhân viên.</span></p><p><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\">- Đề xuất khen thưởng, kỷ luật, xét tăng lương nhân viên theo quy chế công ty.</span></p><p><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\">- Phân công, điều động nhân sự thuộc phạm vi bộ phận mình.</span></p><p><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\">&nbsp;</span></p></td><td width=\"264\" valign=\"top\" style=\"padding: 2.75pt 2.75pt 2.75pt 2.7pt; width: 2.75in;\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\">&nbsp;</span><p align=\"center\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif; color: black;\" data-mce-mark=\"1\">Nam/nữ tuổi từ 30 trở lên,</span></p><p align=\"center\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif; color: black;\" data-mce-mark=\"1\">Tốt nghiệp CĐ trở lên chuyên nghành Marketing ,</span></p><p align=\"center\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif; color: black;\" data-mce-mark=\"1\">Có kinh nghiệm 02 năm ở vị trí tương đương.</span></p><p align=\"center\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif; color: black;\" data-mce-mark=\"1\">Năng lực / kỹ năng:&nbsp;Có khả năng quản lý, điều hành nhóm tốt</span></p><p align=\"center\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif; color: black;\" data-mce-mark=\"1\">Các yêu cầu khác:&nbsp;Sáng tạo trong công việc, khả năng tự ứng xử giải quyết tốt công việc đột xuất</span></p><p align=\"center\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif; color: black;\" data-mce-mark=\"1\">Ưu tiên:&nbsp;Ứng viên có kinh nghiệm và kiến thức chuyên môn trong vị trí công tác</span></p></td></tr><tr><td width=\"108\" valign=\"top\" style=\"padding: 2.75pt 2.75pt 2.75pt 2.7pt; width: 81pt;\"><p align=\"center\" class=\"TableContents\" style=\"text-align: center;\">&nbsp;</p><p align=\"center\" class=\"m_5756220858820078627gmail-TableContents\" style=\"text-align: center; line-height: 13.8px;\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\"><strong>Nhân viên Kỹ thuật</strong></span></p><p align=\"center\" class=\"TableContents\" style=\"text-align: center;\">&nbsp;</p><p align=\"center\" class=\"m_5756220858820078627gmail-TableContents\" style=\"text-align: center; line-height: 13.8px;\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\"><strong>&nbsp;</strong></span></p><p align=\"center\" class=\"TableContents\" style=\"text-align: center;\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\"><strong><span style=\"color: black;\" data-mce-mark=\"1\">Số lượng: 01</span></strong></span></p></td><td width=\"294\" valign=\"top\" style=\"padding: 2.75pt 2.75pt 2.75pt 2.7pt; width: 220.45pt;\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\">-<span style=\"color: black;\" data-mce-mark=\"1\">&nbsp;Tham gia vận chuyển hàng hóa, thực hiện giao, lắp, cài đặt thiết bị và các thủ tục giao nhận, thanh toán tại địa chỉ khách hàng.</span></span><p><span style=\"font-family: arial, helvetica, sans-serif; color: black; font-size: medium;\" data-mce-mark=\"1\">- Lắp ráp bộ máy, cài đặt, kiểm tra, khắc phục lỗi của thiết bị máy tính tại SR<br>- Tư vấn các giải pháp, hỗ trợ kỹ thuật cho khách hàng,<br>- Hướng dẫn khách hàng sử dụng sản phẩm.<br>- Thực hiện các công việc kỹ thuật khác.</span></p></td><td width=\"264\" valign=\"top\" style=\"padding: 2.75pt 2.75pt 2.75pt 2.7pt; width: 2.75in;\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\">&nbsp;<span style=\"color: black;\" data-mce-mark=\"1\">- Nam tuổi dưới 35 tuổi, Sức khỏe tốt.<br>- Tốt nghiệp từ trung cấp trở lên chuyên ngành kỹ thuật, CNTT.<br>- Hiểu biết tốt về các thiết bị IT, Điện tử, Các thiết bị tin học<br>- Chịu được áp lực công việc, trung thực, chịu khó<br>- Ưu tiên ứng viên có kinh nghiệm.</span></span></td></tr><tr><td width=\"108\" valign=\"top\" style=\"padding: 2.75pt 2.75pt 2.75pt 2.7pt; width: 81pt;\"><p align=\"center\" class=\"TableContents\" style=\"text-align: center;\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\"><strong><span style=\"color: black;\" data-mce-mark=\"1\">01 Nhân viên Kinh Doanh Camera</span></strong></span></p></td><td width=\"294\" valign=\"top\" style=\"padding: 2.75pt 2.75pt 2.75pt 2.7pt; width: 220.45pt;\"><div><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\">- Tìm kiếm và khai thác khách hàng.</span></div><div><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\">- Đàm phán, tư vấn, thuyết phục khách hàng.</span></div><div><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\">- Duy trì, phát triển quan hệ với các khách hàng hiện tại, đảm bảo mối quan hệ hợp tác lâu dài với công ty</span></div><div><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\">- Phối hợp chặt chẽ với các phòng ban trong công ty.</span></div><div><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\">- Báo cáo, tham vấn cho Trưởng phòng kinh doanh các hoạt động của thị trường và đối thủ cạnh tranh.</span></div><div><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\">- Chi tiết khác trao đổi trong buổi phỏng vấn.</span></div></td><td width=\"264\" valign=\"top\" style=\"padding: 2.75pt 2.75pt 2.75pt 2.7pt; width: 2.75in;\"><div><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\">- Nam/nữ tuổi từ 18-35, có phương tiện đi lại, có máy tính cá nhân.</span></div><div><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\">- Tốt nghiệp Trung Cấp trở lên, ưu tiên ứng viên tốt nghiệp các chuyên ngành kinh tế. Với những trường hợp đặc biệt có thể xét tốt nghiệp cấp 3 (trường hợp này sẽ được xét dựa trên năng lực cụ thể)</span></div><div><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\">- Ngoại hình khá, yêu thích công việc kinh doanh, nhanh nhẹn, năng động, sáng tạo. ĐẶC BIỆT: Chịu được áp lực công việc.</span></div><div><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\">- Có kỹ năng bán hàng, đàm phán, khả năng thuyết phục cao.</span></div><div><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\">- Ưu tiên các ứng viên đã có kinh nghiệm làm việc tại vị trí tương đương.</span></div></td></tr><tr><td width=\"108\" valign=\"top\" style=\"padding: 2.75pt 2.75pt 2.75pt 2.7pt; width: 81pt;\"><p align=\"center\" class=\"TableContents\" style=\"text-align: center;\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\">&nbsp;</span></p><p align=\"center\" style=\"text-align: center;\"><span style=\"color: rgb(0, 0, 0); font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\"><strong>Nhân viên Kinh doanh Phân phối</strong></span></p><p align=\"center\" class=\"TableContents\" style=\"text-align: center;\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\">&nbsp;</span></p><p align=\"center\" class=\"TableContents\" style=\"text-align: center;\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\"><strong>Số lượng:&nbsp;<strong>02 người</strong></strong></span></p></td><td width=\"294\" valign=\"top\" style=\"padding: 2.75pt 2.75pt 2.75pt 2.7pt; width: 220.45pt;\"><span style=\"color: rgb(0, 0, 0); font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\">&nbsp;</span><p><span style=\"color: rgb(0, 0, 0); font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\"><span style=\"background-image: none; background-position: 0% 0%; background-size: initial; background-repeat: repeat; background-attachment: scroll; background-origin: initial; background-clip: initial;\" data-mce-mark=\"1\">- Bán các mặt hàng máy tính, PC, Laptop cho các đại lý, Khách hàng mua số lượng lớn.</span><br><span style=\"background-image: none; background-position: 0% 0%; background-size: initial; background-repeat: repeat; background-attachment: scroll; background-origin: initial; background-clip: initial;\" data-mce-mark=\"1\">- Thực hiện quy trình bán hàng của Bộ phận, đạt doanh số được giao.</span><br><span style=\"background-image: none; background-position: 0% 0%; background-size: initial; background-repeat: repeat; background-attachment: scroll; background-origin: initial; background-clip: initial;\" data-mce-mark=\"1\">- Công việc trao đổi khi phỏng vấn.</span></span></p></td><td width=\"264\" valign=\"top\" style=\"padding: 2.75pt 2.75pt 2.75pt 2.7pt; width: 2.75in;\"><div><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\">- Nam, tuổi &gt;23, giao tiếp tốt, ngoại hình khá.</span></div><div><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\">-Tốt nghiệp trung cấp trở lên chuyên ngành Kinh tế, QTKD, Công nghệ, bách khoa..</span></div><div><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\">- Có kinh nghiệm ít nhất 1 năm trong lĩnh vực kinh doanh phân phối Sản Phẩm máy tính.&nbsp;</span></div><div><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\">- Ưu tiên có kiến thức cơ bản về Sản phẩm IT.</span></div></td></tr><tr><td width=\"108\" valign=\"top\" style=\"padding: 2.75pt 2.75pt 2.75pt 2.7pt; width: 81pt;\"><p align=\"center\" class=\"TableContents\" style=\"text-align: center;\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\"><strong>Nhân viên thiết kế</strong></span></p><p align=\"center\" class=\"TableContents\" style=\"text-align: center;\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\"><strong>Số lượng: 01</strong></span></p></td><td width=\"294\" valign=\"top\" style=\"padding: 2.75pt 2.75pt 2.75pt 2.7pt; width: 220.45pt;\"><p><span style=\"color: rgb(0, 0, 0); font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\"><span style=\"color: rgb(54, 54, 54);\" data-mce-mark=\"1\">-</span>&nbsp;Thiết kế các ấn phẩm cho cty<br>- Chỉnh sửa ảnh, banner quảng cáo chuyên nghiệp cho công ty và đối tác.<br>- Quản lý mảng hình ảnh và đồ họa nói chung của website công ty</span></p><p><span style=\"color: rgb(0, 0, 0); font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\">- Làm Full time hoặc Part time</span></p></td><td width=\"264\" valign=\"top\" style=\"padding: 2.75pt 2.75pt 2.75pt 2.7pt; width: 2.75in;\"><div><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\">- Tốt nghiệp đại học chuyên ngành đồ họa<br>- Có thể thiết kế và sử dụng tốt các phần mềm thiết kế đồ họa như Photoshop, InDesign, Illustrator, Flash, Corel.<br>- Có kinh nghiệm trong thiết kế đồ họa và thiết kế website<br>- Kỹ năng trong nhiếp ảnh và thiết kế hình ảnh 3D là lợi thế<br>- Có khả năng trình bày ý tưởng thông qua các thiết kế.</span></div><div><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\">- Sáng tạo, có thẩm mỹ cao, có cái nhìn tinh tế trong mỹ thuật về màu sắc, không gian.<br>- Có khả năng làm việc theo nhóm và làm việc độc lập<br>- Công việc đòi hỏi tính sáng tạo cao, có nhiều ý tưởng mới,hay và đặc biệt.<br>- Có kỹ năng và thẩm mỹ trong thiết kế website, banner, tờ rơi<span style=\"color: rgb(54, 54, 54);\" data-mce-mark=\"1\"><br>-</span>&nbsp;có khả năng sử dụng thành thạo các công cụ thiết kế (như vẽ tay và các phần mềm thiết kế đồ họa) để đưa những ý tưởng sáng tạo vào ứng dụng thực tiễn.<br>- Làm việc trong môi trường có tính sáng tạo cao</span></div></td></tr><tr><td width=\"108\" valign=\"top\" style=\"padding: 2.75pt 2.75pt 2.75pt 2.7pt; width: 81pt;\"><p align=\"center\" class=\"TableContents\" style=\"text-align: center;\">&nbsp;</p><p align=\"center\" class=\"TableContents\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\"><strong>Nhân viên kinh doanh bán lẻ tại 131 Lê Thanh Nghị</strong></span></p><p align=\"center\" class=\"TableContents\" style=\"text-align: center;\">&nbsp;</p><p align=\"center\" class=\"TableContents\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\"><strong>Số lượng: 01</strong></span></p><p align=\"center\" class=\"TableContents\" style=\"text-align: center;\">&nbsp;</p></td><td width=\"294\" valign=\"top\" style=\"padding: 2.75pt 2.75pt 2.75pt 2.7pt; width: 220.45pt;\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\">&nbsp;- Tiếp đón khách hàng tại Showroom hoặc qua email, điện thoại.<br>- Tư vấn cho khách hàng thông tin về sản phẩm, các chính sách bán hàng và chương trình khuyến mại đang áp dụng.<br>- Hướng dẫn khách hàng thực hiện thủ tục thanh toán và nhận hàng.<br>- Thực hiện công việc khác theo sự phân công trực tiếp Trưởng bộ phận</span></td><td width=\"264\" valign=\"top\" style=\"padding: 2.75pt 2.75pt 2.75pt 2.7pt; width: 2.75in;\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\">&nbsp;-&nbsp;Nam, tuổi từ 20 đến 25, ngoại hình khá, giao tiếp tốt.</span><p><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\">- Nam có kinh nghiệm bán hàng trong lĩnh vực bán lẻ IT là một lợi thế.<br>- Tốt nghiệp trung cấp trở lên chuyên ngành: Tin học - CNTT; QTKD.<br>- Có kiến thức về các sản phẩm Công nghệ thông tin, Computer.</span></p><p><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\">- Yêu thích kinh doanh, khả năng giao tiếp hiệu quả.</span></p><p><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\">- Chịu được áp lực công việc.</span></p></td></tr></tbody></table><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\"><strong><span style=\"color: red;\" data-mce-mark=\"1\">QUYỀN LỢI:</span></strong></span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\