, helvetica, sans-serif;\" data-mce-mark=\"1\">-Thưởng các ngày Lễ lớn: Tết, 30/4, 2/9....</span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\"><span style=\"background-image: none; background-position: 0% 0%; background-size: initial; background-repeat: repeat; background-attachment: scroll; background-origin: initial; background-clip: initial;\" data-mce-mark=\"1\">- Phụ cấp thâm niên theo năm công tác</span></span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\"><span style=\"background-image: none; background-position: 0% 0%; background-size: initial; background-repeat: repeat; background-attachment: scroll; background-origin: initial; background-clip: initial;\" data-mce-mark=\"1\">- Lương, thưởng, BHXH, phúc lợi theo BLLĐ và theo chính sách ưu đãi nhân sự của Công ty.</span></span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\"><span style=\"background-image: none; background-position: 0% 0%; background-size: initial; background-repeat: repeat; background-attachment: scroll; background-origin: initial; background-clip: initial;\" data-mce-mark=\"1\">- Cơ hội đi học tập, công tác trong nước và nước ngoài.</span></span></p><p class=\"TextBody\" style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span class=\"StrongEmphasis\" style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\"><span style=\"color: red;\" data-mce-mark=\"1\">NỘP HỒ SƠ:</span></span></p><p class=\"TextBody\" style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: m