(298, 'Máy lazer 8 tía Sincon SL 445P', 'may-lazer-8-tia-sincon-sl-445p', 58, 76, 'kgO6_sl335p.jpg', 10800000, '<p><u style=\"color: rgb(51, 51, 51); font-family: roboto; font-size: 16px; text-align: justify;\"><strong>Ứng dụng:&nbsp;</strong></u><br style=\"color: rgb(51, 51, 51); font-family: roboto; font-size: 16px; text-align: justify;\"><span style=\"color: rgb(51, 51, 51); font-family: roboto; font-size: 16px; text-align: justify;\">- Thi công cơ điện: đi dây, máng cáp, công tắc, ổ cắm, lắp đèn, ống dẫn nước, lắp điều hòa nhiệt độ.</span><br style=\"color: rgb(51, 51, 51); font-family: roboto; font-size: 16px; text-align: justify;\"><span style=\"color: rgb(51, 51, 51); font-family: roboto; font-size: 16px; text-align: justify;\">- Đổ sàn: xây dựng và kiểm soát độ cao.</span><br style=\"color: rgb(51, 51, 51); font-family: roboto; font-size: 16px; text-align: justify;\"><span style=\"color: rgb(51, 51, 51); font-family: roboto; font-size: 16px; text-align: justify;\">- Xây dựng nhà tiền chế: dựng cốt, gióng thẳng hàng, lắp dầm, đo.</span><br style=\"color: rgb(51, 51, 51); font-family: roboto; font-size: 16px; text-align: justify;\"><span style=\"color: rgb(51, 51, 51); font-family: roboto; font-size: 16px; text-align: justify;\">- Ốp lát: sàn, tường.</span><br style=\"color: rgb(51, 51, 51); font-family: roboto; font-size: 16px; text-align: justify;\"><span style=\"color: rgb(51, 51, 51); font-family: roboto; font-size: 16px; text-align: justify;\">- Nhôm kính cửa: Lắp cửa sổ, cửa chính, khung cửa, vách ngăn.</span><br style=\"color: rgb(51, 51, 51); font-family: roboto; font-size: 16px; text-align: justify;\"><span style=\"color: rgb(51, 51, 51); font-family: roboto; font-size: 16px; text-align: justify;\">- Cảnh quan vườn và kiến trúc: vườn, vỉa hè, lối đi, hàng rào, lan can, tay vịn, gờ.</span><br style=\"color: rgb(51, 51, 51); font-family: roboto; font-size: 16px; text-align: justify;\"><span style=\"color: rgb(51, 51, 51); font-family: roboto; font-size: 16px; text-align: justify;\">- Lắp đặt cửa hàng &amp; bếp: treo kệ, tủ, kệ chén, lót sàn.</span><br style=\"color: rgb(51, 51, 51); font-family: roboto; font-size: 16px; text-align: justify;\"><span style=\"color: rgb(51, 51, 51); font-family: roboto; font-size: 16px; text-align: justify;\">- Xây dựng cao ốc: làm móng, đổ bê tông sàn, kiểm tra mặt cắt, tường.</span><br style=\"color: rgb(51, 51, 51); font-family: roboto; font-size: 16px; text-align: justify;\"><span style=\"color: rgb(51, 51, 51); font-family: roboto; font-size: 16px; text-align: justify;\">- Khảo sát: giám sát thi công, đo đạc.</span><br style=\"color: rgb(51, 51, 51); font-family: roboto; font-size: 16px; text-align: justify;\"><span style=\"color: rgb(51, 51, 51); font-family: roboto; font-size: 16px; text-align: justify;\">- Đóng trần thạch cao.&nbsp;</span><img src=\"data:image/jpeg;base64,\" data-filename=\"sl335p (1).jpg\" style=\"width: 720px;\"></p><p style=\"margin-top: 13px; margin-bottom: 13px; font-variant-numeric: normal; font-variant-east-asian: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; padding: 0px; border: 0px; outline: 0px; font-size: 13px; vertical-align: baseline; font-family: Arial, &quot;Arial Unicode MS&quot;, Helvetica, sans-serif; line-height: 22.75px; widows: 1;\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; font-family: &quot;Times New Roman&quot;;\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: large; vertical-align: baseline; background: transparent;\"><strong style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background: transparent;\">THÔNG SỐ KỸ THUẬT&nbsp;<a href=\"http://xaydungduylan.com/may-tia-lazer.html\">Máy lazer 8 tía Sincon SL 445P</a></s