(203, 'Đá Rối Lai Châu Đa Sắc PJM-DR0003', 'da-roi-lai-chau-da-sac-pjm-dr0003', 27, 48, 'TyA9_gach-da-sac-soloo.jpg', 0, 'MÔ TẢ SẢN PHẨM\r\nĐá rối đa sắc: Kích thước: Ngẫu nhiên; Nhận đặt theo yêu cầu. - Màu sắc tự nhiên, không phai màu theo thời gian. - Không thấm nước, không rêu mốc. - Không trơn trượt, ma sát tốt. - Khả năng chịu nhiệt, chịu lạnh tốt. - Khả năng chống ăn mòn bởi các loại axit, đạt tiêu chuẩn Anh BS 680.Màu đen tự nhiên, không đổ mồ hôi, không trơn trượt, không rêu mốc. ', '2', 'Đa Roi Lai Chau DA Sac PJM-DR0003', 'đá trang trí . đá ốp lát . đá slate ,đá chẻ ...', 0, '2018-08-20', '2018-08-20');
