(265, ' Máy cân bằng laser tia xanh Laisai LSG-686D', 'may-can-bang-laser-tia-xanh-laisai-lsg-686d', 58, 77, 'OlW9_2.jpg', 0, '<p><a href=\"http://xaydungduylan.com/may-can-bang-laser-tia-xanh-laisai-lsg-686d\" style=\"background-color: rgb(255, 255, 255); font-family: roboto; font-size: 12px; text-align: justify;\"><strong style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; font-family: arial, sans-serif; vertical-align: baseline; color: rgb(68, 68, 68);\">Máy cân bằng laser tia xanh Laisai LSG686D</strong></a><strong style=\"text-align: justify; margin: 0px; padding: 0px; border: 0px; outline: 0px; font-family: arial, sans-serif; vertical-align: baseline; color: rgb(68, 68, 68);\">&nbsp;</strong><span style=\"text-align: justify; color: rgb(68, 68, 68); font-family: arial, sans-serif;\">với ánh sáng tia xanh mạnh mẽ là một trợ thủ đắc lực cho công trình thi công&nbsp;thiết kế&nbsp;ngoài trời, các công trình ngoại thất với cường độ ánh sáng mạnh. Cùng với thiết kế đặc biệt với&nbsp;chức&nbsp;năng chống sốc, chống bụi và chống nước, máy có thể làm việc ở những môi trường khắc nghiệt, môi trường độ ẩm cao, môi trường nhiều bụi đất. Ngoài ra máy còn có tính năng khóa tia laser để thi công cầu thang và đường chéo</span></p><p><span style=\"text-align: justify; color: rgb(68, 68, 68); font-family: arial, sans-serif;\"><br></span></p><p style=\"margin-bottom: 20px; padding: 0px; border: 0px; outline: 0px; font-family: arial, sans-serif; vertical-align: baseline; line-height: 1.4em; color: rgb(68, 68, 68); text-align: justify;\"><strong style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-style: inherit; font-family: inherit; vertical-align: baseline;\">Ứng dụng của máy cân bằng Laser tia xanh</strong>:</p><ul style=\"margin-right: 0px; margin-bottom: 20px; margin-left: -10px; padding: 0px 0px 0px 2em; border: 0px; outline: 0px; font-family: arial, sans-serif; vertical-align: baseline; list-style-position: initial; list-style-image: initial; line-height: 1.4em; color: rgb(68, 68, 68);\"><li style=\"margin: 0px; padding: 0px 0px 5px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline; text-align: justify;\">Thi công cơ điện: đi dây, máng cáp, công tắc, ổ cắm, lắp đèn, ống dẫn nước, lắp điều hòa nhiệt độ.</li><li style=\"margin: 0px; padding: 0px 0px 5px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline; text-align: justify;\">Ốp lát: sàn, tường.</li><li style=\"margin: 0px; padding: 0px 0px 5px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline; text-align: justify;\">Lắp đặt trong cửa hàng &amp; bếp: treo kệ, tủ, kệ chén, lót sàn.</li><li style=\"margin: 0px; padding: 0px 0px 5px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline; text-align: justify;\">Trang trí nội thất: ốp tường, chạy chỉ, sơn nước, lắp tranh, màn cửa, đèn.</li><li style=\"margin: 0px; padding: 0px 0px 5px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline; text-align: justify;\">Khảo sát: giám sát thi công, đo đạc.</li><li style=\"margin: 0px; padding: 0px 0px 5px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline; text-align: justify;\">Đóng trần thạch cao, cửa nhôm kính: Lắp cửa sổ, cửa chính, khung cửa, vách ngăn.</li><li style=\"margin: 0px; padding: 0px 0px 5px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline; text-align: justify;\">Xây dựng nhà: dựng cột, gióng thẳng hàng, đo, điều khiển.</li><li style=\"margin: 0px; padding: 0px 0px 5px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline; text-align: justify;\"><strong style=\"text-align: start; font-family: inherit; font-style: inherit; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline;\"><br></strong></li><li style=\"margin: 0px; padding: 0px 0px 5px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline; text-align: justify;\"><strong style=\"text-align: start; font-family: inherit; font-style: inherit; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline;\">THÔNG SỐ KỸ THUẬT</strong></li><li style=\"margin: 0px; padding: 0px 0px 5px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline; text-align: justify;\"><ul style=\"margin-right: 0px; margin-bottom: 20px; margin-left: -10px; padding: 0px 0px 0px 2em; text-align: start; border: 0px; outline: 0px; vertical-align: baseline; list-style-position: initial; list-style-image: initial; line-height: 1.4em;\"><li style=\"margin: 0px; padding: 0px 0px 5px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline;\">Mô hình: 4V1H1D</li><li style=\"margin: 0px; padding: 0px 0px 5px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline;\">Số lượng tia: 1 tia ngang, 4 tia đứng, 1 tia dọi tâm</li><li style=\"margin: 0px; padding: 0px 0px 5px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline;\">Phạm vi làm việc: 20-30m (Tùy từng điệu kiện ánh sáng)</li><li style=\"margin: 0px; padding: 0px 0px 5px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline;\">Độ chính xác: ±1mm/10m</li><li style=\"margin: 0px; padding: 0px 0px 5px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline;\">Chế độ cân bằng: Cân bằng tự động, tự động bù nghiêng&nbsp;±3°</li><li style=\"margin: 0px; padding: 0px 0px 5px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline;\">Thời gian cân bằng tự động: 5\"</li><li style=\"margin: 0px; padding: 0px 0px 5px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline;\">Chế độ điều chỉnh tia Laser: Có 2 chế độ điều chỉnh tia Laser: đậm và mảnh</li><li style=\"margin: 0px; padding: 0px 0px 5px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline;\">Chế đó khóa tia Laser</li><li style=\"margin: 0px; padding: 0px 0px 5px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline;\">Hãng sản xuất: Laisai-china</li></ul></li></ul>', '2', 'May Can Bang Laser Tia Xanh Laisai LSG-686D', 'máy cân bàng laser , máy tia laze....', 0, '2018-08-21', '2018-08-21'),
