(277, 'Máy laser tia xanh SINCON SL-270P', 'may-laser-tia-xanh-sincon-sl-270p', 58, 79, '3dcL_SL270PPP.jpg', 0, '<div class=\"col-md-8 col-sm-7 thongtinsp\" style=\"padding-right: 10px; padding-left: 10px; width: 533.328px;\"><div class=\"detailpro\" style=\"color: rgb(51, 51, 51); font-family: roboto; font-size: 12px; margin-bottom: 15px;\"><span style=\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px;\">* Sản phẩm được sử dụng rất phổ biến phục vụ thi công các hạng mục xây dựng trong phòng, trang trí nội thất...</span></div><div class=\"detailpro\" style=\"margin-bottom: 15px;\"><font color=\"#1d2129\" face=\"Helvetica, Arial, sans-serif\">GIỚI THIỆU&nbsp;</font></div><div class=\"detailpro\" style=\"margin-bottom: 15px;\"><span style=\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif;\">Ứng dụng công nghiệp:</span><br style=\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif;\"><span style=\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif;\">• Ứng dụng trong thi công trần</span><br style=\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif;\"><span style=\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif;\">• Thi công lắp đặt máy lạnh, đường ống nước, chống cháy.</span><br style=\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif;\"><span style=\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif;\">• Thi công lắp đặt cửa đi, cửa sổ các loại.</span><br style=\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif;\"><span style=\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif;\">• Thi công ốp đá, gạch men</span><br style=\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif;\"><span style=\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif;\">• Thi công nâng cốt nền.</span><br style=\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif;\"><spa