ial, sans-serif; font-size: 14px;\">- Tự động cân bằng, tạo tia laser cân bằng&nbsp;</span><br style=\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px;\"><span style=\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px;\">- Máy chiếu tạo tia laser: 4V+1H+1D+1C</span><br style=\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px;\"><span style=\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px;\">- Cấp laser: Cấp II, 635nm - Sai số: ±1mm/10m</span><br style=\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px;\"><span style=\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px;\">- Khả năng làm việc: 20m</span><br style=\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px;\"><span style=\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px;\">- Tự động cân bằng trong khoảng: ±30 khi máy bị nghiêng</span><br style=\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px;\"><span style=\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px;\">- Nguồn: 3xAA - Hoạt động liện tục trong 8h</span><br style=\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px;\"><span style=\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px;\">- Kích thước: 105x180mm</span><br style=\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px;\"><span style=\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px;\">- Khối lượng: 1.2kg</span><br style=\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px;\"><span style=\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px;\">- Khả năng đo cả trong nhà và ngoài trờ</span><br style=\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px;\"><span style=\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px;\">- Tiêu chuẩn chống nuớc: IP54</span></div></div></div></div></div></div></div></div></div><div class=\"container \" style=\"padding-right: 10px; padding-left: 10px; margin-top: 0px; margin-bottom: 0px; width: 1200px; color: rgb(51, 51, 51); font-family: roboto; font-size: 12px;\"><div class=\"row\" style=\"margin-right: -10px; margin-left: -10px;\"><div class=\"col-md-12 bottom2\" style=\"padding-right: 10px; padding-left: 10px; width: 1200px; margin: 10px 0px;\"><div class=\"row\" style=\"margin-right: -10px; margin-left: -10px;\"><div class=\"col-md-6 col-sm-5 col-xs-12\" style=\"padding-right: 10px; padding-left: 10px; width: 600px;\"></div></div></div></div></div></div></div><div class=\"col-md-4 col-sm-5 thongtinmua\" style=\"padding-right: 10px; padding-left: 10px; width: 266.656px; color: rgb(51, 51, 51); font-family: roboto; font-size: 12px;\"><div class=\"box_price\" style=\"background: url(&quot;../images/pro-price-bg.png&quot;) center center repeat-y scroll transparent; padding-bottom: 15px; margin-bottom: 15px;\"></div></div>', '2', 'May laser tia xanh SiNCON SL-27P', 'máy cân bằng lazai . may tia laze, máy đo kinh vĩ ... ', 0, '2018-08-21', '2018-08-21'),
