(283, 'Máy lazer SL-3D', 'may-lazer-sl-3d', 58, 76, 'B1lh_sd3.jpg', 0, '<p><strong style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px;\">Máy cân mực laser tia Sincon SL-3D&nbsp;</strong><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px;\">gồm 3 tia chạy vong 360 độ có chế độ khóa tia cho ứng dụng nghiêng, dùng để: ốp sát sàn, tường, lắp đặt cửa hàng và bếp: treo kệ, tủ, kệ chen, lót sà</span></p><p><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px;\">GIỚI THIỆU&nbsp;</span></p><p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px;\"><strong>Ứng dụng</strong>:</p><p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px; text-align: justify;\">Thi công cơ điện:đi dây, máng cáp, công tắc,ổ cắm, lắp đèn, ống dẫn nước, lắp điều hòa nhiệt độ.</p><p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px; text-align: justify;\">Ốp lát: sàn, tường.</p><p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px; text-align: justify;\">Lắp đặt cửa hàng &amp; bếp: treo kệ, tủ kệ chén, lót sàn.</p><p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px; text-align: justify;\">Trang trí&nbsp;<span style=\"font-weight: inherit;\">nội thất</span>: ốp tường, chạy chỉ, sơn nước lắp tranh, màn cửa, đèn.</p><p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px; text-align: justify;\">Khảo sát: giám sát thi công, đo đạc</p><p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px; text-align: justify;\">Đóng trần thạch cao.</p><p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px; text-align: justify;\">Nhôm kính cửa: lắp cửa sổ, cửa chính, khung cửa, vách ngăn.</p><p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px; text-align: justify;\">Đóng tàu:những công việc nội thất.</p><p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px; text-align: justify;\">- Đặc biệt thích hợp cho các công việc ng</p><p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px; text-align: justify;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"2tia3.jpg\" style=\"width: 720px;\"><br></p><p><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px;\"><br></span></p><p><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px;\"><br></span></p><p><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px;\"><br></span><br></p>', '2', 'May lazer Sl-3D', 'máy cân bằng lazai . may tia laze, máy đo kinh vĩ ... ', 0, '2018-08-21', '2018-08-21'),
