(289, 'Máy lazer 5 tia xanh SIMITO-508X', 'may-lazer-5-tia-xanh-simito-508x', 58, 76, '5rbR_308x2.jpg', 2650000, '<p><p><span style=\"color: rgb(51, 51, 51); font-family: roboto; font-size: 12px; text-align: justify;\">MÁY CÂN MỰC TIA LASER XANH SIMITO - 508X LÀ MẪU MÁY LASER XÂY DƯNG &nbsp;LIÊN DOANH CỦA NHẬT BẢN, SỬ DỤNG CÔNG NGHỆ VÀ THIẾT BỊ NHẬP KHẨU TỪ NHẬT BẢN VỚI CHẤT LƯỢNG ỔN ĐỊNH, ĐỘ BÈN CAO, MÁY CÓ HỆ THỐNG BẢNG MẠCH NHẬP KHẨU TỪ NHÀ MÁY SIMITO NHẬT BẢN, SIMITO LÀ THƯƠNG HIỆU MÁY ĐIỆN TỬ LỚN CHUYEN CUNG CẤP LINH PHỤ KIỆN CHO NGÀNH CÔNG NGHIỆP CHẾ TẠO KỸ THUẬT CAO TẠI NHẬT BẢN.</span></p><p><span style=\"color: rgb(51, 51, 51); font-family: roboto; font-size: 12px; text-align: justify;\">GIỚI THIỆU&nbsp;</span><span style=\"font-size: 16px; color: rgb(51, 51, 51); font-family: roboto; text-align: justify;\">&nbsp;Đặc điểm:</span></p><div style=\"color: rgb(51, 51, 51); font-family: roboto; font-size: 12px;\"><span style=\"font-size: 12pt;\">- &nbsp; 1 tia laser cân bằng ngang.</span></div><div style=\"color: rgb(51, 51, 51); font-family: roboto; font-size: 12px;\"><span style=\"font-size: 12pt;\">- &nbsp; 4 tia cùng vuông góc và cắt nhau</span></div><div style=\"color: rgb(51, 51, 51); font-family: roboto; font-size: 12px;\"><span style=\"font-size: 12pt;\">- &nbsp; Khóa bảo vệ bộ phát laser trong quá trình vận chuyển.</span></div><div style=\"color: rgb(51, 51, 51); font-family: roboto; font-size: 12px;\"><span style=\"font-size: 12pt;\">- &nbsp; 1 điểm dọi xuống sàn.</span></div><div style=\"color: rgb(51, 51, 51); font-family: roboto; font-size: 12px;\"><span style=\"font-size: 12pt;\">- &nbsp; Có thể tắt chức năng tự cân bằng để làm những công việc cần độ nghiêng.</span></div><div style=\"color: rgb(51, 51, 51); font-family: roboto; font-size: 12px;\"><span style=\"font-size: 12pt;\">- &nbsp; Dùng với chân máy ngắn đặt nằm trên sàn và chân máy cao.</span></div><div style=\"color: rgb(51, 51, 51); font-family: roboto; font-size: 12px;\"><span style=\"font-size: 12pt;\">- &nbsp; Tia nằm ngang có thể điều chỉnh xoay vòng 360<span style=\"position: relative; font-size: 12px; line-height: 0; vertical-align: baseline; top: -0.5em;\">o</span>.</span></div><div style=\"color: rgb(51, 51, 51); font-family: roboto; font-size: 12px;\"><span style=\"font-size: 12pt;\">- &nbsp; Phát âm báo khi độ nghiêng vượt quá ± 3.5<span style=\"position: relative; font-size: 12px; line-height: 0; vertical-align: baseline; top: -0.5em;\">o</span></span></div><div style=\"color: rgb(51, 51, 51); font-family: roboto; font-size: 12px;\"><span style=\"font-size: 12pt;\">- &nbsp; Dùng kết hợp với bộ nhận tín hiệu laser FR 55 để gia tăng khoảng cách làm việc lên 40m.</span></div><div style=\"color: rgb(51, 51, 51); font-family: roboto; font-size: 12px;\"><span style=\"font-size: 12pt;\">- &nbsp; Bảo vệ chống nước và bụi cấp độ IP54.</span></div><span style=\"color: rgb(51, 51, 51); font-family: roboto; font-size: 12pt;\">- &nbsp; Vỏ máy được bọc 1 lớp cao su.</span></p><h2 style=\"font-family: roboto; color: rgb(51, 51, 51); text-align: justify;\"><span style=\"font-size: 14px;\">Thông Số Kỹ Thuật Máy:&nbsp;</span></h2><ul style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: roboto; font-size: 12px;\"><li><h2 style=\"text-align: justify;\"><span style=\"font-size: 14px;\"><em>Độ nghiêng tự cân bằng: &nbsp;-± 3.5<span style=\"position: relative; font-size: 10.5px; line-height: 0; vertical-align: baseline; top: -0.5em;\">o</span></em></span></h2></li><li><h2 style=\"text-align: justify;\"><span style=\"font-size: 14px;\"><em><span style=\"position: relative; font-size: 10.5px; line-height: 0; vertical-align: baseline; top: -0.5em;\">Độ chính xác:&nbsp;± 3mm/10m.</span></em></span></h2></li><li><h2 style=\"text-align: justify;\"><span style=\"font-size: 14px;\"><em><span style=\"position: relative; font-size: 10.5px; line-height: 0; vertical-align: baseline; top: -0.5em;\">Bán kính làm việc (không dùng bộ nhận tín hiệu laser): 20m</span></em></span></h2></li><li><h2 style=\"text-align: justify;\"><span style=\"font-size: 14px;\"><em><span style=\"position: relative; font-size: 10.5px; line-height: 0; vertical-align: baseline; top: -0.5em;\">Bán kính làm việc (dùng bộ nhận tín hiệu laser) : 40m.</span></em></span></h2></li><li><h2 style=\"text-align: justify;\"><span style=\"font-size: 14px;\"><em><span style=\"position: relative; font-size: 10.5px; line-height: 0; vertical-align: baseline; top: -0.5em;\">Thời gian làm việc: 12 Giờ</span></em></span></h2></li><li><h2 style=\"text-align: justify;\"><span style=\"font-size: 14px;\"><em><span style=\"position: relative; font-size: 10.5px; line-height: 0; vertical-align: baseline; top: -0.5em;\">Nguồn điện (Pin sạc hoặc dùng điện lưới thông qua bộ sạc):&nbsp;3 x 1.5V NiMH (Có thể dùng pin Alkaline).</span></em></span></h2></li><li><h2 style=\"text-align: justify;\"><span style=\"font-size: 14px;\"><em><span style=\"position: relative; font-size: 10.5px; line-height: 0; vertical-align: baseline; top: -0.5em;\">Diode Laser/Cấp Laser:6 x 635 nm/3R.</span></em></span></h2></li><li><h2 style=\"text-align: justify;\"><span style=\"font-size: 14px;\"><em><span style=\"position: relative; font-size: 10.5px; line-height: 0; vertical-align: baseline; top: -0.5em;\">Trọng lượng:&nbsp;3 kg</span>&nbsp;</em></span></h2></li></ul><p><p><span style=\"color: rgb(51, 51, 51); font-family: roboto; font-size: 12px; text-align: justify;\"><br></span><br></p></p>', '2', 'May lazer 5 tia xanh SiMITO-580x', 'máy cân bằng lazai . may tia laze, máy đo kinh vĩ ... ', 0, '2018-08-21', '2018-08-21'),
(290, 'MST25081', 'mst25081', 45, 2, '7Crf_MST25081-s-3494-s-3605.jpg', 450000, '<p>gạch mosaic bể bơi&nbsp;</p>', '2', 'MST25081', 'trang trí gạch mosaic bể bơi ', 10, '2018-08-21', '2018-08-21');
