(291, 'Máy Bắn Cốt Tia Laser Tia Xanh SMT-668', 'may-ban-cot-tia-laser-tia-xanh-smt-668', 58, 79, 'jN4d_laserxanhsmt_5102 (1).jpg', 4500000, '<p>GIỚI THIỆU</p><p><img src=\"data:image/jpeg;base64,\" data-filename=\"laserxanhsmt_5102.jpg\" style=\"width: 745px;\"></p><p><span style=\"color: rgb(51, 51, 51); font-family: roboto; text-align: justify; font-size: 12pt;\">THÔNG SỐ </span></p><p><span style=\"color: rgb(51, 51, 51); font-family: roboto; text-align: justify; font-size: 12pt;\">Máy cân mực laser SIMITO, 5 Tia Xanh Siêu Sáng Cao Cấp ( Tia Xanh Hỗ Trợ Ngoài Trời)</span><br style=\"color: rgb(51, 51, 51); font-family: roboto; font-size: 12px; text-align: justify;\"><span style=\"color: rgb(51, 51, 51); font-family: roboto; text-align: justify; font-size: 12pt;\">Model:&nbsp;SMT-668</span><br style=\"color: rgb(51, 51, 51); font-family: roboto; font-size: 12px; text-align: justify;\"><span style=\"color: rgb(51, 51, 51); font-family: roboto; text-align: justify; font-size: 12pt;\">Thương hiệu:&nbsp;SIMITO- JAPAN</span><br style=\"color: rgb(51, 51, 51); font-family: roboto; font-size: 12px; text-align: justify;\"><span style=\"color: rgb(51, 51, 51); font-family: roboto; text-align: justify; font-size: 12pt;\">Phạm vi đo: 0 - 15m</span><br style=\"color: rgb(51, 51, 51); font-family: roboto; font-size: 12px; text-align: justify;\"><span style=\"color: rgb(51, 51, 51); font-family: roboto; text-align: justify; font-size: 12pt;\">Cấp bảo vệ IP54</span><br style=\"color: rgb(51, 51, 51); font-family: roboto; font-size: 12px; text-align: justify;\"><span style=\"color: rgb(51, 51, 51); font-family: roboto; text-align: justify; font-size: 12pt;\">Phạm vi sai số: ±0.2mm/m</span><br style=\"color: rgb(51, 51, 51); font-family: roboto; font-size: 12px; text-align: justify;\"><span style=\"color: rgb(51, 51, 51); font-family: roboto; text-align: justify; font-size: 12pt;\">Số tia laser : 4 Tia Đứng, 1 Tia Ngang Thăng Bằng.&nbsp;</span><br style=\"color: rgb(51, 51, 51); font-family: roboto; font-size: 12px; text-align: justify;\"><span style=\"color: rgb(51, 51, 51); font-family: roboto; text-align: justify; font-size: 12pt;\">Phạm vi tự động cân bằng: +/- 3 Độ</span><br style=\"color: rgb(51, 51, 51); font-family: roboto; font-size: 12px; text-align: justify;\"><span style=\"color: rgb(51, 51, 51); font-family: roboto; text-align: justify; font-size: 12pt;\">Pin sử dụng: Lithium - 4,7 Vol. Sử Dụng Sạc, Adapter 220Vol.</span><br style=\"color: rgb(51, 51, 51); font-family: roboto; font-size: 12px; text-align: justify;\"><span style=\"color: rgb(51, 51, 51); font-family: roboto; text-align: justify; font-size: 12pt;\">Bộ Máy bao gồm: 01 máy chính + 1 Hộp Máy + 01 Quả Pin Lithium + 1 chân Máy Cao 1,2 Mét+01 Kính Bảo Vệ +01 Sạc Pin, Khớp Nối Làm Nghiêng.</span><br></p>', '2', 'May Bắn Cốt Tia Laser Tia Xanh SMT-668', 'máy cân bằng lazai . may tia laze, máy đo kinh vĩ ... ', 10, '2018-08-21', '2018-08-21');
INSERT INTO `product` (`id`, `product_name`, `product_namekd`, `subcate_id`, `nsx_id`, `product_img`, `product_price`, `product_info`, `product_status`, `product_model`, `product_tag`, `product_salevalue`, `created_at`, `updated_at`) VALUES
(148, 'Keo Prefect ốp lát đá trong nhà ASIA- P04', 'keo-prefect-op-lat-da-trong-nha-asia-p04', 50, 14, 'tpvQ_p04-ct.jpg', 7500, 'Keo Prefect ốp lát đá trong nhà ASIA- P04 là vật liệu  xi măng kết hợp phụ gia Polymer biến tính, được ứng dụng trong thi công ốp lát các loại gạch, đá tự nhiên, đá nhân tạo..Thành phần chính gồm xi măng, cốt liệu thô, cốt liệu mịn chọn lọc, các loại phụ gia polymer biến tính và các loại phụ gia khác, được phối trộn với nhau theo tỷ lệ nhất đinh, đóng bao kín, dể vận chuyển và sử dụng với nhiều ưu điểm như độ bám dính cao, không bong rộp, chống thấm, chống trượt, thời gian thi công kéo dài…', '1', 'P04', '', 5, '2018-08-20', '2018-08-20'),
(149, 'Keo ốp lát gạch đá Mosaic ASIA- P06', 'keo-op-lat-gach-da-mosaic-asia-p06', 50, 14, 'kOvP_p06-test6.jpg', 11500, 'Keo ốp lát gạch đá Mosaic ASIA- P06 ốp lát là vật liệu  xi măng kết hợp phụ gia Polymer biến tính, được ứng dụng trong thi công ốp lát các loại gạch, đá tự nhiên, đá nhân tạo..Thành phần chính gồm xi măng, cốt liệu thô, cốt liệu mịn chọn lọc, các loại phụ gia polymer biến tính và các loại phụ gia khác, được phối trộn với nhau theo tỷ lệ nhất đinh, đóng bao kín, dể vận chuyển và sử dụng với nhiều ưu điểm như độ bám dính cao, không bong rộp, chống thấm, chống trượt, thời gian thi công kéo dài…\r\nSản phẩm ASIA-P06 : keo Perfect chuyên dùng ốp và lát các loại gạch mosaic, mosaic bể bơi,... khu vực ngoài nhà.\r\n\r\nThông số:\r\nĐịnh dạng: bột khô\r\nMàu sắc: trắng \r\nTỷ lệ trộn nước: 20-23%\r\nThời gian sử dụng sau khi trộn: >3h\r\nThời gian cho phép lưu thông nhẹ: sau 24h\r\nThời gian cho phép chít mạch : trên tường:sau 6h, trên sàn: sau 24h\r\nLượng dùng  : 4-6 kg/m­­2 (thay đổi tùy thuộc cốt nền, tay ghề thợ thi công, dụng cụ và phương pháp thi công)\r\n\r\nĐóng gói: Bao 10 KG\r\n\r\nBảo quản: 12 tháng nơi khô thoáng', '2', 'P06', '', 5, '2018-08-20', '2018-08-20'),
(150, 'Keo Prefect ốp lát ngoài trời ASIA- P03', 'keo-prefect-op-lat-ngoai-troi-asia-p03', 50, 14, 'WN7D_p03-ct.jpg', 10500, 'Keo Prefect ốp lát ngoài trời ASIA- P03 là vật liệu  xi măng kết hợp phụ gia Polymer biến tính, được ứng dụng trong thi công ốp lát các loại gạch, đá tự nhiên, đá nhân tạo..Thành phần chính gồm xi măng, cốt liệu thô, cốt liệu mịn chọn lọc, các loại phụ gia polymer biến tính và các loại phụ gia khác, được phối trộn với nhau theo tỷ lệ nhất đinh, đóng bao kín, dể vận chuyển và sử dụng với nhiều ưu điểm như độ bám dính cao, không bong rộp, chống thấm, chống trượt, thời gian thi công kéo dài…\r\n\r\nSản phẩm ASIA-P03 : keo Perfect  loại đặc biệt, chuyên dùng thi công ốp lát đá khu vực ngoài trời, ốp lát gạch và đá khổ lớn, vị trí chịu rung động như bể bơi, mặt ngoài thang máy, vị trí chịu tác động của nhiệt độ như mái ngói, mái đá, mặt tiền nhà cao tầng, ốp gạch đá lên vách thạch cao, tấm xi măng…\r\n\r\nTHÔNG SỐ\r\n\r\nĐịnh dạng: bột khô\r\nMàu sắc: trắng hoặc xám\r\nTỷ lệ trộn nước: 20-23%\r\nThời gian sử dụng sau khi trộn: >5h\r\nThời gian cho phép lưu thông nhẹ: sau 24h\r\nThời gian cho phép chít mạch : trên tường:sau 10 h, trên sàn: sau 24h\r\nLượng dùng: 4-6 kg/m­­2 (thay đổi tùy thuộc cốt nền, tay ghề thợ thi công, dụng cụ và phương pháp thi công)\r\nVị trí sử dụng: ốp lát gạch đá ở các vị trí đặc biệt (mặt tiền, mái đá mái ngói, bể bơi ngoài trời, mặt ngoài thang máy, thạch cao, tấm ximang board)\r\nĐóng gói: Bao 25 KG\r\n\r\nBảo quản: 12 tháng nơi khô thoáng\r\n\r\nTrường hợp thay thế nước bằng dung dịch SPD-P08, nhằm tăng cườnghơn nữa tính bám dính, chống thấm và đàn hồi của sản phẩm …\r\n\r\nTCVN 7899:2008\r\n\r\nISO 9001:2008\r\nKeo ASIA- P03: Keo Perfect chuyên dùng để ốp và lát các loại gạch ceramic, granit kích thước lớn, đá tự nhiên, đá nhân tạo, đá trang trí, đá mỹ thuật… khu vực ngoài nhà nơi chịu nhiều tác động của thời tiết, áp lực nước, tải trọng lớn:  bể bơi, mái đá, mái ngói, tấm vách thạch cao, vách xi măng board, dán các vật liệu gốc silicat\r\nMàu sắc: Xám\r\nLượng dùng: 4- 6 kg/ m2 ( tùy vào cốt nền, tay nghề thợ thi công, dụng cụ và phương pháp thi công)\r\nĐóng gói: Bao 25 kg\r\nBảo quản: 12 tháng nơi khô thoáng\r\nHướng dẫn sử dụng:\r\n- Tỷ lệ trộn nước: 26- 28% ( tương đương 6.7 lít/ bao 25kg)\r\n- Đổ lượng nước phù hợp với lượng keo cần trộn vào thùng, từ từ cho keo vào thùng, dùng máy khuấy trộn đều hỗn hợp cho đến khi đồng nhất không vón cục dạng vừa dẻo, bám dính cao, dừng trộn khoảng 3 phút, sau đó trộn lại và sử dụng\r\nCó thể thay thế nước bằng dung dịch tăng cường SPD- P08 để tăng tính bám dính, chống thấm và đàn hồi của sản phẩm\r\n\r\nTCVN 7899:2008\r\n   ISO 9001:2008', '2', 'ASIA- P03', 'keo dan gạch, keo dán đá, keo ốp lát', 10, '2018-08-20', '2018-08-20'),
(151, 'Keo Epoxy hai thành phần AE- 3000 ( 20Kg/ bộ)', 'keo-epoxy-hai-thanh-phan-ae-3000-20kg-bo-', 50, 14, 'Hrxg_epoxy_20kg_0906.png', 13500, 'Keo AE- 3000 là keo Epoxy hai thành phần, bám dính rất cao, được chế tạo với công thức phù hợp cho gắn kết các vật liệu theo điểm, định hình tốt trên bề mặt thẳng đứng, không chảy nhão ở nhiệt độ cao, được ứng dụng trong gắn kết các loại gạch, đá tự nhiên, đá nhân tạo, sửa chữa vết nứt bê tông, kim loại, gắn và sửa chữa gỗ hoặc các vật liệu tương tự...\r\nThông số:\r\n- Tỷ lệ trộn ( A: B): 1:1\r\n- Đóng rắn hoàn toàn: 4- 6 giờ\r\n- Trạng thái: Dẻo dính, định hình\r\n- Màu sắc: Trắng vào xám\r\n- Bảo quản: 2 năm ( 23 độ C)\r\n- Bao bì: Bộ 3, 10, 20..kg\r\nĐặc tính:\r\n- Cường độ bám dính cao\r\n- Cường độ chịu uốn cao\r\n- Cường độ chịu nén cao\r\n- Thi công trên dải nhiệt độ rất rộng ( 5- 45 độ C)\r\n- Đóng rắn nhanh\r\n- Dễ dàng sử dụng ( định hình tốt, tỷ lệ trộn 1:1)\r\n- Không gây ố màu cho đá, lý tưởng cho các loại đá cẩm thạch, đá sáng màu ( hoặc các loại gạch, đá tương tự khác...)\r\n- Chịu được shock và rung động\r\n- Liên kết bền vững, không lão hóa\r\n- Không chứa dung môi, an toàn cho môi trường và người sử dụng\r\n- Sử dụng trong nhà và ngoài trời\r\nỨng dụng:\r\n- Gắn đính điểm đá tự nhiên ( granite, marble..), gạch khổ lớn trên tường và các vị trí trep cao, trong nhà và ngoài trời\r\n- Gắn đá móc treo\r\n- Sửa chữa các vết nứt bê tông, sửa chữa, gắn kết gỗ và kim loại\r\n- Keo dán cho xây dựng, bê tông đúc sẵn và đá\r\n- Keo gắn cho các vị trí thang máy và bậc thềm\r\n- Keo gắn hoặc sửa chữa các loại gạch đá\r\n- Keo gắn và dán các loại sắt, gỗ đá...', '2', ' AE- 3000 ', 'keo dan gạch, keo dán đá, keo ốp lát, ', 10, '2018-08-20', '2018-08-20'),
(152, 'Keo Epoxy hai thành phần AE- 3000 ( 2Kg/ bộ)', 'keo-epoxy-hai-thanh-phan-ae-3000-2kg-bo-', 50, 14, 'vtNt_apoxy_2kg.png', 12500, 'Keo AE- 3000 là keo Epoxy hai thành phần, bám dính rất cao, được chế tạo với công thức phù hợp cho gắn kết các vật liệu theo điểm, định hình tốt trên bề mặt thẳng đứng, không chảy nhão ở nhiệt độ cao, được ứng dụng trong gắn kết các loại gạch, đá tự nhiên, đá nhân tạo, sửa chữa vết nứt bê tông, kim loại, gắn và sửa chữa gỗ hoặc các vật liệu tương tự...\r\nThông số:\r\n- Tỷ lệ trộn ( A: B): 1:1\r\n- Đóng rắn hoàn toàn: 4- 6 giờ\r\n- Trạng thái: Dẻo dính, định hình\r\n- Màu sắc: Trắng vào xám\r\n- Bảo quản: 2 năm ( 23 độ C)\r\n- Bao bì: Bộ 3, 10, 20..kg\r\nĐặc tính:\r\n- Cường độ bám dính cao\r\n- Cường độ chịu uốn cao\r\n- Cường độ chịu nén cao\r\n- Thi công trên dải nhiệt độ rất rộng ( 5- 45 độ C)\r\n- Đóng rắn nhanh\r\n- Dễ dàng sử dụng ( định hình tốt, tỷ lệ trộn 1:1)\r\n- Không gây ố màu cho đá, lý tưởng cho các loại đá cẩm thạch, đá sáng màu ( hoặc các loại gạch, đá tương tự khác...)\r\n- Chịu được shock và rung động\r\n- Liên kết bền vững, không lão hóa\r\n- Không chứa dung môi, an toàn cho môi trường và người sử dụng\r\n- Sử dụng trong nhà và ngoài trời\r\nỨng dụng:\r\n- Gắn đính điểm đá tự nhiên ( granite, marble..), gạch khổ lớn trên tường và các vị trí trep cao, trong nhà và ngoài trời\r\n- Gắn đá móc treo\r\n- Sửa chữa các vết nứt bê tông, sửa chữa, gắn kết gỗ và kim loại\r\n- Keo dán cho xây dựng, bê tông đúc sẵn và đá\r\n- Keo gắn cho các vị trí thang máy và bậc thềm\r\n- Keo gắn hoặc sửa chữa các loại gạch đá\r\n- Keo gắn và dán các loại sắt, gỗ đá...', '2', 'AE- 3000 ( 2Kg/ bộ)', 'keo dan gạch, keo dán đá, keo ốp lát', 10, '2018-08-20', '2018-08-20'),
(153, 'lát nền Thạch anh', 'lat-nen-thach-anh', 8, 7, '27E3_thạch anh.jpg', 0, '', '2', 'lát nền Thạch anh', 'trang trí ốp lát lát nền vĩnh cửu ', 0, '2018-08-20', '2018-08-20'),
(154, 'Keo Epoxy hai thành phần AE- 3000 ( 10Kg/ bộ)', 'keo-epoxy-hai-thanh-phan-ae-3000-10kg-bo-', 50, 14, '5pNP_apxoy_10kg_0206.png', 0, 'Keo Epoxy hai thành phần AE- 3000 ( 10Kg/ bộ) là keo Epoxy hai thành phần, bám dính rất cao, được chế tạo với công thức phù hợp cho gắn kết các vật liệu theo điểm, định hình tốt trên bề mặt thẳng đứng, không chảy nhão ở nhiệt độ cao, được ứng dụng trong gắn kết các loại gạch, đá tự nhiên, đá nhân tạo, sửa chữa vết nứt bê tông, kim loại, gắn và sửa chữa gỗ hoặc các vật liệu tương tự...\r\nKeo Epoxy hai thành phần AE- 3000 ( 10Kg/ bộ) là keo Epoxy hai thành phần, bám dính rất cao, được chế tạo với công thức phù hợp cho gắn kết các vật liệu theo điểm, định hình tốt trên bề mặt thẳng đứng, không chảy nhão ở nhiệt độ cao, được ứng dụng trong gắn kết các loại gạch, đá tự nhiên, đá nhân tạo, sửa chữa vết nứt bê tông, kim loại, gắn và sửa chữa gỗ hoặc các vật liệu tương tự...', '2', 'AE- 3000 ( 10Kg/ bộ)', 'keo dan gạch, keo dán đá, keo ốp lát', 0, '2018-08-20', '2018-08-20'),
(155, 'Keo Perfec chít mạch màu trắng CMM-00', 'keo-perfec-chit-mach-mau-trang-cmm-00', 50, 14, 'O2Lw_cmm-ct.jpg', 0, 'Keo chít mạch Perfect, thành phần bao gồm xi măng, cốt liệu chọn lọc, mầu vô cơ, các loại phụ gia Polymer biển tính…được sử dụng trong thi công chít mạch gạch, mạch đá, trong nhà và ngoài trời,khu vực bể bơi…\r\nKeo chít mạch Perfect, thành phần bao gồm xi măng, cốt liệu chọn lọc, mầu vô cơ, các loại phụ gia Polymer biển tính…được sử dụng trong thi công chít mạch gạch, mạch đá, trong nhà và ngoài trời, khu vực bể bơi…\r\n\r\nMàu sắc đa dạng\r\nBền màu\r\nBám dính tốt\r\nLinh động cao\r\nChống thấm, chống nấm mốc\r\nThân thiện với môi trường\r\n\r\nĐóng bao: 20, 5, 2 kg\r\n\r\nBảo quản: 12 tháng nơi khô thoáng\r\n\r\nTCVN 7899:2008\r\n\r\nISO 9001:2008', '2', ' CMM-00', 'keo dan gạch, keo dán đá, keo ốp lát', 0, '2018-08-20', '2018-08-20'),
(156, 'Keo chít mạch gốc Epoxy AJG-16', 'keo-chit-mach-goc-epoxy-ajg-16', 50, 14, 'eHTc_chitmach_epoxy-Copy-5.png', 0, 'Keo chít mạch gốc Epoxy AJG-16 là keo chít mạch 2 thành phần gốc nhựa epoxy, được thiết kế đặc biệt cho mục đích chít mạch gạch và đá, với khả năng bám dính cao, kháng hóa chất, chống thấm tuyệt đối, không rêu mốc, kháng khuẩn…ứng dụng trong nhà và ngoài trời, môi trường công nghiệp và dân dụng…Đặc tính:\r\n\r\nCường độ bám dính cao\r\nKhả năng kháng hóa chất tốt\r\nKhông thấm màu\r\nChống rêu mốc, chống bám bẩn\r\nDễ dàng sử dụng và vệ sinh\r\nLiên kết bền vững không lão hóa\r\nKhông chứa dung môi, an toàn cho môi trường và người sử dụng\r\nSử dụng trong nhà và ngoài trời\r\nSử dụng:\r\n\r\nChít mạch (joint mạch)  gạch và đá…\r\n Chít mạch trong thi công ốp lát gạch đá dân dụng, trong nhà hoặc ngoài trời, chít mạch khu vực bếp, bể bơi nước nóng, bể bơi nước mặn..\r\nChít mạch gạch chịu hóa chất trong các lĩnh vực sản xuất thực phẩm như nhà máy nước ngọt, nhà máy sữa,  chế biến cá… các nhà máy công nghiệp như nhà máy điện, chế tại pin…\r\nChít mạch gạch các khu vực thường xuyên dùng hóa chất để tẩy rửa như phòng thí nghiệm, bệnh viện, bếp công nghiệp, nơi thường xuyên tiếp xúc với muối, nước nóng\r\nPhối trộn:\r\n\r\nHai thành phần của keo Apoxy AJG-16 (A:B) khi sử dụng được phối trộn với nhau theo tỷ lệ 2:1 (về khối lượng), trộn thật đều đến khi đồng nhất về ,àu sắc\r\nChỉ cần trộn lượng cần thiết trong vòng 2-3 phút, sau đó sử dụng hết, nên sử dụng máy khuấy để trộn đều hai thành phần với nhau\r\nSau khi trộn đều sử dụng bay chít mạch chuyên dụng, điền đẩy keo chít mạch vào khe mạch, vét phần còn dư trên bề mặt\r\nSau khi chít mạch, bề mặt cần được làm sạch ngay lập tức trước khi keo khô. Sử dụng miếng mút chuyên dụng, hoặc vải khô để vệ sinh phần keo bám trên bề mặt gạch, có thể sử dụng hóa chất chuyên dụng để làm sạch bề mặt\r\n', '2', '  AJG-16', 'keo dan gạch, keo dán đá, keo ốp lát', 0, '2018-08-20', '2018-08-20'),
(157, ' lát nền  Saphia', 'lat-nen-saphia', 8, 7, 'ecsQ_saphia.jpg', 0, 'Quy cách (dimension)\r\n\r\n400 x 400 x 32 (mm)', '2', ' lát nền  Saphia', 'trang trí ốp lát lát nền vĩnh cửu ', 0, '2018-08-20', '2018-08-20'),
(158, 'KEO PAST GỐC NHỰA AROLPRO', 'keo-past-goc-nhua-arolpro', 50, 14, 'XOLc_AROLPRO_pts.png', 0, 'Keo AROLPRO có độ bám dính rất cao trên nhiều chất liệu. An toàn, không độc hại, không chứa dung môi. Đóng rắn theo cơ chế thoát ẩm (hơi nước ). Cường độ chịu uốn cao, có khả năng thi công tại những vị trí chịu rung lắc, cốt nền rung động.. Công thứcđặc biệt cho phép thay thế hoặc sửa chữa dễ dàng. Khả năng bám dính cao, chống trượt, cường độ cắt cao là sự lựa chọn lý tưởng cho thi công dán các loại gạch ceramic, mosaic, tấm sợi thủy tinh, sàn nhựa, thảm nhựa... trên nhiều loại cốt nền khác nhau. Không gây bụi, không dung môi, thuận tiên tối đa khi sử dụng. Không bắt lửa\r\nThông số:\r\n- Trạng thái: tương tự bơ\r\n- Màu sắc: Trắng đục\r\n- Bảo quản: 2 năm ( 23 độ C)\r\n- Open time: 30 phút\r\n- Thời gian thi công: 50 phút\r\nỨng dụng:\r\n- Dán san vinyl, VCT, thảm nhựa, dán các loại gạch ceramic, mosaic, sửa chữa vết nứt trên tường, ráp nối thạch cao, keo cho giấy dán tường, trên các bề mặt có khả năng thoát ẩm/ bên trong nhà/ bên trong các khu dịch vụ, văn phòng, khách sạn, rạp chiếu phim\r\nBên trong các khu công cộng như bệnh viện, trường học, thư viện...', '2', '  AROLPRO', 'keo dan gạch, keo dán đá, keo ốp lát', 0, '2018-08-20', '2018-08-20'),
(159, ' lát nền Opal', 'lat-nen-opal', 8, 7, 'sWXI_opal.jpg', 0, 'Quy cách (dimension)\r\n\r\n400 x 400 x 32 (mm)', '2', ' lát nền Opal', 'trang trí ốp lát lát nền vĩnh cửu ', 0, '2018-08-20', '2018-08-20'),
(160, 'Đá Chẻ Nâu 3 Sọc KT 50x200mm PJM0025', 'da-che-nau-3-soc-kt-50x200mm-pjm0025', 28, 46, '2Z7v_Untitled25.png', 0, 'Sản phẩm đá trang trí tự nhiên của chúng tôi bao gồm những sản phẩm có chất liệu đá quý hiếm nhập ngoại và những sản phẩm sử dụng nguyên liệu nội địa được chế tác tinh xảo bởi những nghệ nhân giàu kinh nghiệm, ở những làng nghề nổi tiếng về điêu khắc đá như Ninh Bình, Thanh Hóa, Nghệ An, Đà Nẵng… Ngoài ra, chúng tôi chuyên tư vấn thiết kế thi công hoàn thiện cảnh quan các công trình dân dụng và công nghiệp, bao gồm: thiết kế thi công sân vườn, tiểu cảnh trong nhà, hòn non bộ, thác nước, tranh đá ốp tường nghệ thuật, đồi cỏ biệt thự, nhà hàng, đài phun nước…. Chúng tôi cam kết đem đến cho khách hàng những giải pháp thiết kế tiểu cảnh, sân vườn đẹp với chất lượng tốt nhất trong từng điều kiện cụ thể. Cảnh quan sân vườn đẹp do chúng tôi tạo nên giá trị thẩm mỹ, giảm căng thẳng, tạo ra một môi trường làm việc và sinh hoạt “dễ chịu” cho con người…  ', '2', 'Đa che Nâu 3 Sọc KT 50x200mm PJM0025', 'đá trang trí . đá ốp lát ... ', 0, '2018-08-20', '2018-08-20'),
(161, 'lát nền Mã não', 'lat-nen-ma-nao', 7, 7, 'AMIO_mã não.jpg', 0, 'Quy cách (dimension)\r\n\r\n400 x 400 x 32 (mm)', '2', 'lát nền Mã não', 'trang trí ốp lát lát nền vĩnh cửu ', 0, '2018-08-20', '2018-08-20'),
(162, 'Đá Bóc Ốp Tường KT 100x300mm PJM-0033', 'da-boc-op-tuong-kt-100x300mm-pjm-0033', 28, 46, 'f5Ry_Untitled33.png', 0, 'Sản phẩm đá trang trí tự nhiên của chúng tôi bao gồm những sản phẩm có chất liệu đá quý hiếm nhập ngoại và những sản phẩm sử dụng nguyên liệu nội địa được chế tác tinh xảo bởi những nghệ nhân giàu kinh nghiệm, ở những làng nghề nổi tiếng về điêu khắc đá như Ninh Bình, Thanh Hóa, Nghệ An, Đà Nẵng… Ngoài ra, chúng tôi chuyên tư vấn thiết kế thi công hoàn thiện cảnh quan các công trình dân dụng và công nghiệp, bao gồm: thiết kế thi công sân vườn, tiểu cảnh trong nhà, hòn non bộ, thác nước, tranh đá ốp tường nghệ thuật, đồi cỏ biệt thự, nhà hàng, đài phun nước…. Chúng tôi cam kết đem đến cho khách hàng những giải pháp thiết kế tiểu cảnh, sân vườn đẹp với chất lượng tốt nhất trong từng điều kiện cụ thể. Cảnh quan sân vườn đẹp do chúng tôi tạo nên giá trị thẩm mỹ, giảm căng thẳng, tạo ra một môi trường làm việc và sinh hoạt “dễ chịu” cho con người… Dưới bàn tay tài hoa của những người thợ thủ công, kết hợp với công nghệ hiện đại, chúng tôi tin tưởng rằng sản phẩm đá trang trí của mình sẽ đáp ứng được yêu cầu của những khách hàng khó tính nhất. Hy vọng sản phẩm của chúng tôi sẽ tô điểm thêm vẻ đẹp của ngôi nhà bạn, đem lại phong cách ấn tượng cho quán cafe hay nét trang trọng cho công ty bạn từ cái nhìn cảm quan đầu tiên     ', '2', 'Đa Boc Op Tuong KT 100x300mm PJM-0033', 'đá trang trí . đá ốp lát . đá slate ,đá chẻ ...', 0, '2018-08-20', '2018-08-20'),
