(178, 'Đá Granite Bóc Sần Ốp Chân Tường - Granite Mushroom Wall', 'da-granite-boc-san-op-chan-tuong-granite-mushroom-wall', 28, 46, '3nOi_-granite-b--c-s---n----p-ch--n-t-----ng-granite-mushroom-wall-01.jpeg', 0, 'Về đá lát sân vườn Granite : hay gọi là đá hoa cương, là loại đá tự nhiên được hình thành do sự biến chất của các loại đá vôi, đá carbonate hay đá dolomit. Quá trình biến chất tái tinh thể hóa các loại đá trầm tích này để thành các vân tinh thể đá xen kẽ lẫn nhau . Vì kết cấu tinh thể, đá lát sân vườn Granite có độ cứng cao, ít thấm nước, có thể lát ở các vị trí chịu xước, mài mòn như cầu thang bộ, sàn nhà, mặt tiền…Thường vì giá thành thấp hơn đá marble, dễ thi công hơn vì ít gãy, mẻ nên nhìn chung đá Granite thường được dùng rộng rãi là loại đá lát sân vườn được ưa chuộng. Việt Nam rất nổi tiếng với các mỏ đá ở miền Trung. Khí hậu ở đây nóng nên đá granite ở đây có độ bền về cơ học, màu sắc rất cao ngay cả với các công trình ở chịu nắng gió. So với các loại đá Granite ở các nước khác, điển hình là Trung Quốc thì chất lượng vượt trội về độ cứng, bền màu và được các nước trên thế giới đánh giá cao.  ', '2', 'Đa Granite Boc San Op Chan Tuong- Granite Mushroom Wall', 'đá trang trí . đá ốp lát . đá slate ,đá chẻ ...', 0, '2018-08-20', '2018-08-20'),
(179, 'Đá Bóc Sần PJM-001', 'da-boc-san-pjm-001', 28, 46, 'CP32_-b--c-s---n-NLDB-001-02.jpg', 0, 'Mô tả sản phẩm đá lát sân vườn - đá bóc sần PJM-001 Xuất xứ: Sản phẩm này có nguyên liệu từ vùng núi Nghệ An, Thanh Hóa và được chế tác tại chỗ, hoặc có thể nguyên liệu được chuyển về một số địa phương khác để chế tác. Màu sắc sản phẩm: Đá bóc sần có gam màu chính là màu gi sáng. Nhưng vì là đá tự nhiên, được hình thành từ quá trình kiến tạo địa chất nên khối đá tự nhiên thường có các vân đá (các lớp đá). Vì vậy, màu sắc của loại đá này có màu rất tự nhiên và không đồng nhất. Phương pháp chế tác: Đá bóc sần (lồi) là đá chẻ tự nhiên cắt theo quy cách. Hai viên đá bóc thường được tách đôi từ một khối đá hộp chữ nhật nên bề mặt gồ ghề lồi lõm, vì vậy nó giữ được vẻ thô tự nhiên của đá. Đặc điểm sản phẩm: Đá bóc đen 10×20 cm là loại đá lát sân vườn rất phổ biến và được ưa chuộng nhất trong các loại đá trang trí sản xuất tại Việt Nam. Một số hình ảnh tham khảo đá lát sân vườn - đá bóc sần PJM-001  ', '2', 'Đa Boc San PJM-001', 'đá trang trí . đá ốp lát . đá slate ,đá chẻ ...', 0, '2018-08-20', '2018-08-20'),
(180, 'Đá Bóc Sần PJM-002', 'da-boc-san-pjm-002', 28, 46, 'c6xA_da-boc-san-mt-nldb-002-1.jpeg', 0, 'SO SÁNH SẢN PHẨM\r\nBạn có không có mục nào để so sánh.\r\nMÔ TẢ SẢN PHẨM\r\nMô tả sản phẩm đá lát sân vườn - đá bóc sần PJM-002 Xuất xứ:\r\nSản phẩm này có nguyên liệu từ vùng núi Nghệ An, Thanh Hóa và được chế tác tại chỗ, hoặc có thể nguyên liệu được chuyển về một số địa phương khác để chế tác.\r\n\r\nMàu sắc sản phẩm:\r\nĐá bóc sần có gam màu chính là màu gi sáng. Nhưng vì là đá tự nhiên, được hình thành từ quá trình kiến tạo địa chất nên khối đá tự nhiên thường có các vân đá (các lớp đá). Vì vậy, màu sắc của loại đá này có màu rất tự nhiên và không đồng nhất.\r\n\r\nPhương pháp chế tác:\r\nĐá bóc sần (lồi) là đá chẻ tự nhiên cắt theo quy cách. Hai viên đá bóc thường được tách đôi từ một khối đá hộp chữ nhật nên bề mặt gồ ghề lồi lõm, vì vậy nó giữ được vẻ thô tự nhiên của đá.\r\n\r\nĐặc điểm sản phẩm:\r\nĐá bóc sần PJM-002 10x20 cm là loại đá lát sân vườn rất phổ biến và được ưa chuộng nhất trong các loại đá trang trí sản xuất tại Việt Nam.', '2', 'Đa Boc San PJM-002', 'đá trang trí . đá ốp lát . đá slate ,đá chẻ ...', 0, '2018-08-20', '2018-08-20'),
(181, 'Đá Lát Sân Vườn Đá Mẻ Xanh Tối PJM-00076', 'da-lat-san-vuon-da-me-xanh-toi-pjm-00076', 28, 46, 'q7uA_Da-lat-san-vuon-da-me-xanh-toi-MT-00076-1.jpg', 0, 'Với đặc tính cơ bản như độ cứng cao, ít thấm nước, chống mài mòn tốt, ít bị ảnh hưởng bởi thời tiết và hầu như không cần bảo dưỡng, đá xanh (Bluestone) được đánh giá là vật liệu lý tưởng cho các hạng mục ngoài trời. Nhờ những đặc tính nêu trên, đá xanh có thể được gia công thành nhiều mặt thành phẩm khác nhau như: giả cổ, bề mặt nhám, bóng, băm, mẻ…Thành phẩm đá mẻ có các kích thước (cm) phổ biến từ 10x10, 20x20 tới 80x80, độ dày từ 1cm đến 5cm. Đá mẻ được sử dụng phổ biến để làm đá lát sân vườn, đường, vỉa hè, lối đi, công viên. Cùng tham khảo số đặc tính của đá mẻ xanh tối dưới đây\r\n;Tên sản phẩm\r\n	Đá lát sân vườn mẻ Xanh tối\r\nỨng dụng\r\n	Được sử dụng trong bên ngoài như đá lát sân vườn, đường hồ bơi và các ứng dụng xây dựng chuyên môn khác.	\r\nĐặc điểm vật lý	\r\nMàu sắc: xanh & vàng Khoáng sản chính: CaCO3 Tỷ trọng: 2,78 g/cm3 Hấp thụ nước: 0,14%	\r\nKích thước\r\n15 x 15 x 2,5 cm; 20 x 20 x 2,5 cm;', '2', 'Da Lat San Vuon Da Me Xanh Toi PJM-0076', 'đá trang trí . đá ốp lát . đá slate ,đá chẻ ...', 0, '2018-08-20', '2018-08-20'),
(182, 'Đá Lát Sân Vườn Đá Doremon Đen PJM-00074', 'da-lat-san-vuon-da-doremon-den-pjm-00074', 28, 46, 'I7d0_UntitledDSG.png', 0, 'hông tin sản phẩm đá Doremon đen PJM-00074\r\nQuy cách\r\n400 x 400 x 40mm\r\nTrọng lượng	\r\n13.2kg/viên\r\nĐộ nén	\r\n>= 350 kg/cm2\r\nĐộ uốn	\r\n>= 60 kg/cm2\r\nĐộ hút nước\r\n<= 6%\r\nĐá Doremon lát nền xuất phát ý tưởng từ những giọt nước đọng lại sau cơn mưa rào, nét độc đáo ở Sản phẩm này là những giọt mưa bong bóng lớn nhỏ đan xen một cách hài hòa và hoang sơ cho ta cảm giác gần gũi với thiên nhiên.\r\nĐá lát sân vườn có rất nhiều loại và vật liệu khác nhau để tạo nên một khu vườn đẹp và lát đá tự nhiên không thể thiếu trong việc trang trí sân vườn. Đá lát sân vườn - Đá Doremon đen mang màu sắc trang nhã dễ áp dụng với các công trình như lát sân vườn, lối đi, công viên...\r\nNgoài ra đá lát sân vườn Doremon còn có màu trắng cũng là một sự lựa chọn tối ưu trong việc trang trí nhà sân vườn. Kết hợp 2 loại đá Doremon trắng - đen đem đến vẻ đẹp hoàn hảo cho căn nhà của bạn.', '2', 'Đa Lat San Vuon Đa Doremon Đe PJM-00074', 'đá trang trí . đá ốp lát . đá slate ,đá chẻ ...', 0, '2018-08-20', '2018-08-20'),
(183, 'Đá Lát Sân Vườn Đá Doremon Trắng PJM-00075', 'da-lat-san-vuon-da-doremon-trang-pjm-00075', 28, 46, 'SbpT_Untitledh.png', 0, 'Đá Doremon lát nền xuất phát ý tưởng từ những giọt nước đọng lại sau cơn mưa rào, nét độc đáo ở Sản phẩm này là những giọt mưa bong bóng lớn nhỏ đan xen một cách hài hòa và hoang sơ cho ta cảm giác gần gũi với thiên nhiên.\r\nĐá lát sân vườn có rất nhiều loại và vật liệu khác nhau để tạo nên một khu vườn đẹp và lát đá tự nhiên không thể thiếu trong việc trang trí sân vườn. Đá lát sân vườn - Đá Doremon trắng mang màu sắc trang nhã dễ áp dụng với các công trình như lát sân vườn, lối đi, công viên...\r\nNgoài ra đá lát sân vườn Doremon còn có màu đen cũng là một sự lựa chọn tối ưu trong việc trang trí nhà sân vườn. Kết hợp 2 loại đá trang trí Doremon trắng - đen đem đến vẻ đẹp hoàn hảo cho căn nhà của bạn.', '2', 'Đa Lat San Vuon Da Doremon Trang PJM-00075', 'đá trang trí . đá ốp lát . đá slate ,đá chẻ ...', 0, '2018-08-20', '2018-08-20'),
(184, 'Chậu Đá Tự Nhiên: PJM-MAR1-5', 'chau-da-tu-nhien-pjm-mar1-5', 28, 46, 'zKbk_Untitled.png', 0, 'MÔ TẢ SẢN PHẨM\r\nNhập khẩu nguyên chiếc từ Pakistan. Làm thủ công, cắt, mài, khoét từ đá khối khai thác tự nhiên.\r\nTrọng lượng	Khoảng 15kg / chiếc.\r\nKích thước	Ðường kính 400mm x cao 150mm\r\nLoại đá	Marble Pakistan, vàng cốm.', '2', 'Chau Đa Tu Nhien PJM-MAR1-5', 'chậu đá tự nhiên , chậu đá ,đá trang trí . đá ốp lát . đá slate ,đá chẻ ...', 0, '2018-08-20', '2018-08-20'),
(185, 'Đá Lát Sân Vườn Lục Giác Trắng Đen PJM-00071', 'da-lat-san-vuon-luc-giac-trang-den-pjm-00071', 28, 46, 'MDWf_Da-lat-san-vuon-luc-giac-trang-den-MT-00071.jpeg', 0, 'Đáp lại sự ưa chuộng và tin dùng của khách hàng đối với bộ sưu tập Gạch Sỏi, Đại Sàn tiếp tục phát triển bộ sưu tập Đá Suối với nhiều kiểu dáng tự nhiên và độc đáo giúp khách hàng có thêm sự chọn lựa cho sản phẩm đá lát sân vườn, lát vỉa hè, sân vườn, công viên...\r\n\r\nĐá suối có 3 loại kích thước vuông 400mm, lục giác 400mm và 300x600mm kết hợp với 4 màu trắng, đen, hồng và đa sắc\r\n', '2', 'Da Lat San Vuon Luc Giac Trang Đen PJM- 00071', 'đá trang trí . đá ốp lát . đá slate ,đá chẻ ...', 0, '2018-08-20', '2018-08-20'),
(186, 'Gạch Lát Sân Vườn Lục Giác Hạt Đen Lớn PJM-00079', 'gach-lat-san-vuon-luc-giac-hat-den-lon-pjm-00079', 28, 46, 'bG5Y_Da-lat-san-vuon-luc-giac-hat-den-lon-MT-00079-1 (1).jpg', 0, 'Quy cách	\r\n400 x 400 x 40mm\r\nTrọng lượng	\r\n13kg/viên\r\nĐộ nén	\r\n>= 350 kg/cm2	\r\nĐộ uốn\r\n>= 60 kg/cm2		\r\nĐộ hút nước\r\n<= 6%\r\n', '2', 'Gach Lat San Vuon Luc Giac Hat Den Lon PJM-00079', 'đá trang trí . đá ốp lát . đá slate ,đá chẻ ...', 0, '2018-08-20', '2018-08-20'),
(187, 'Đá Lát Sân Vườn Lục Giác Hạt Trắng Lớn PJM-00072', 'da-lat-san-vuon-luc-giac-hat-trang-lon-pjm-00072', 28, 46, 'oQy4_MT-00072.jpg', 0, ' Đá suối lát nền - đá lát sân vườn\r\nĐáp lại sự ưa chuộng và tin dùng của khách hàng đối với bộ sưu tập Gạch Sỏi, Đại Sàn tiếp tục phát triển bộ sưu tập Đá Suối với nhiều kiểu dáng tự nhiên và độc đáo giúp khách hàng có thêm sự chọn lựa cho sản phẩm đá trang trí lát vỉa hè, sân vườn, công viên...\r\n\r\nĐá suối có 3 loại kích thước vuông 400mm, lục giác 400mm và 300x600mm kết hợp với 4 màu trắng, đen, hồng và đa sắc.\r\n\r\n ', '2', 'Da Lat San Vuon Luc Giac Hat Trang Lon PJM-00072', 'đá trang trí . đá ốp lát . đá slate ,đá chẻ ...', 0, '2018-08-20', '2018-08-20'),
(188, 'Đá Lát Sân Vườn Trắng Đen PJM-00077', 'da-lat-san-vuon-trang-den-pjm-00077', 28, 46, 'jsto_UntitledD.png', 0, 'Đá suối lát nền - đá lát sân vườn\r\nĐáp lại sự ưa chuộng và tin dùng của khách hàng đối với bộ sưu tập Gạch Sỏi, Đại Sàn tiếp tục phát triển bộ sưu tập Đá Suối với nhiều kiểu dáng tự nhiên và độc đáo giúp khách hàng có thêm sự chọn lựa cho sản phẩm đá trang trí lát vỉa hè, sân vườn, công viên...\r\n\r\nĐá suối có 3 loại kích thước vuông 400mm, lục giác 400mm và 300x600mm kết hợp với 4 màu trắng, đen, hồng và đa sắc.', '2', 'Đa Lat San Vuon Tranng Đen PjM -00077', 'đá trang trí . đá ốp lát . đá slate ,đá chẻ ...', 0, '2018-08-20', '2018-08-20'),
(189, 'Đá Lát Sân Vườn Đá Cubic PJM-00073', 'da-lat-san-vuon-da-cubic-pjm-00073', 28, 46, 'K3al_Da-lat-san-vuon-da-Cubic-MT-00073.jpg', 0, '\r\n\r\nĐá Cubic được sản xuất từ chất liệu bê tông với bề mặt là sự kết hợp hài hòa giữa các vân đá tự nhiên với các rãnh nhân tạo, do đó sản phẩm có khả năng chống trơn trượt và có thể thoát nước nhanh chóng.\r\n\r\nVới 3 gam màu đặc trưng: cam vàng, xám tro, đỏ gạch kết hợp với 2 kích thước vuông 300mm, 400mm\r\n\r\nSản phẩm đá cubic thường được sử dụng để làm đá trang trí ngoại thất như thi công ốp lót vỉa hè, đường phố cổ, hành lang sân ga, bãi đậu xe, khách sạn, nhà hàng, biệt thự, sân vườn, quảng trường, công viên, các công trình cổ...', '2', 'Đá Lát Sân Vườn Đá Cubic PJM-00073', 'đá trang trí . đá ốp lát . đá slate ,đá chẻ ...', 0, '2018-08-20', '2018-08-20'),
(190, 'Đá Tự Nhiên PJM-DMS0009', 'da-tu-nhien-pjm-dms0009', 28, 46, 'Ev3W_da-tu-nhien-mt-dms0009.jpg', 0, 'Quy cách đóng gói\r\n	1 hộp = 10~11 viên\r\nTrọng lượng viên\r\n	1.8-2.2 kg\r\nTrọng lượng hộp\r\n18-22 kg\r\nMÔ TẢ SẢN PHẨM\r\nMosaic đá là nghệ thuật ghép mảnh từ các vật liệu như đá, gạch, thủy tinh, …có từ thời La Mã cổ đại và được ứng dụng nhiều trong kiến trúc công cộng như nhà thờ, đền đài, cung điện… Ngày nay, Mosaic đá được ứng dụng rộng rãi trong nhiều lĩnh vực, đắc dụng nhất là trang trí nội ngoại thất kiến trúc.\r\nVới tính uyển chuyển, sáng tạo, tỉ mỉ trong gia công và thiết kế, các sản phẩm đá Mosaic đá do Newland cung cấp được sử dụng trong các hạng mục khác nhau ở bên trong và bên ngoài các công trình xây dựng. Đó có thể là các bức tường trang trí nổi bật sảnh khách sạn, quán bar, lối đi… hay trang trí trong phòng khách, phòng ngủ, bể bơi, nhà tắm, phòng vệ sinh… Dù ứng dụng ở hạng mục nào, đá Mosaic cũng luôn tạo được những không gian đẹp, có chiều sâu và mang tính thẩm mỹ cao. Mosaic đá là một dòng sản phẩm rất dễ trang trí nội và ngoại thất nhất là trang trí tạo điểm nhấn nội thất bởi các đặc tính riêng biệt thống nhất trong khối sản phẩm và có khả năng kết nối tạo tính hài hòa với các vật liệu hoàn thiện khác\r\nCùng với thế mạnh về nguồn nguyên liệu đá tự nhiên phong phú khai trong nước và nhập khẩu, Newland đã và đang cung cấp cho thị trường trong nước và xuất khẩu (Châu Âu, Bắc Mỹ, Australia…) nhiều loại đá Mosaic với đa dạng kích thước, màu sắc, phù hợp với thiết kế nội ngoại thất của khách hàng.\r\n', '2', 'Đa Tu Nhien PJM- DMS0009', 'đá trang trí . đá ốp lát . đá slate ,đá chẻ ...', 0, '2018-08-20', '2018-08-20'),
(191, 'Đá Tự Nhiên PJM-DMS0008', 'da-tu-nhien-pjm-dms0008', 28, 46, 'QrNg_da-tu-nhien-mt-dms0008.jpg', 0, 'MÔ TẢ SẢN PHẨM\r\nQuy cách đóng gói	Trọng lượng viên	Trọng lượng hộp\r\n1 hộp = 10~11 viên	1.8-2.2 kg	18-22 kgda-tu-nhien-PJm-dms0008\r\nMosaic đá là nghệ thuật ghép mảnh từ các vật liệu như đá, gạch, thủy tinh, …có từ thời La Mã cổ đại và được ứng dụng nhiều trong kiến trúc công cộng như nhà thờ, đền đài, cung điện… Ngày nay, Mosaic đá được ứng dụng rộng rãi trong nhiều lĩnh vực, đắc dụng nhất là trang trí nội ngoại thất kiến trúc.\r\nVới tính uyển chuyển, sáng tạo, tỉ mỉ trong gia công và thiết kế, các sản phẩm đá Mosaic đá do Newland cung cấp được sử dụng trong các hạng mục khác nhau ở bên trong và bên ngoài các công trình xây dựng. Đó có thể là các bức tường trang trí nổi bật sảnh khách sạn, quán bar, lối đi… hay trang trí trong phòng khách, phòng ngủ, bể bơi, nhà tắm, phòng vệ sinh… Dù ứng dụng ở hạng mục nào, đá Mosaic cũng luôn tạo được những không gian đẹp, có chiều sâu và mang tính thẩm mỹ cao. Mosaic đá là một dòng sản phẩm rất dễ trang trí nội và ngoại thất nhất là trang trí tạo điểm nhấn nội thất bởi các đặc tính riêng biệt thống nhất trong khối sản phẩm và có khả năng kết nối tạo tính hài hòa với các vật liệu hoàn thiện khác\r\nCùng với thế mạnh về nguồn nguyên liệu đá tự nhiên phong phú khai trong nước và nhập khẩu, Newland đã và đang cung cấp cho thị trường trong nước và xuất khẩu (Châu Âu, Bắc Mỹ, Australia…) nhiều loại đá Mosaic với đa dạng kích thước, màu sắc, phù hợp với thiết kế nội ngoại thất của khách hàng.\r\n ', '2', 'Đa Tu Nhien PJM-DMS0008', 'đá trang trí . đá ốp lát . đá slate ,đá chẻ ...', 0, '2018-08-20', '2018-08-20'),
