(197, 'Đá Lai Châu Lợp Mái Mũi Hài PJM-DLC0027', 'da-lai-chau-lop-mai-mui-hai-pjm-dlc0027', 27, 48, 'FcNa_da-lai-chau-lop-mai-mui-hai-mt-dlc0027.jpg', 0, 'MÔ TẢ SẢN PHẨM\r\nKích thước:14cm x 21cm; dày (5±1)mm ĐÁ LỢP MÁI LAI CHÂU: Hình mũi hài. Kích thước tiêu chuẩn: 20x30cm; 18x27cm; 14x21cm, độ dày (5±1)mm; Nhận đặt theo yêu cầu. - Màu sắc tự nhiên, không phai màu theo thời gian. - Không thấm nước, không rêu mốc. - Khả năng chống nóng tốt. - Khả năng chịu nhiệt, chịu lạnh tốt. Không bị vỡ hoặc cong vênh bởi nhiệt độ môi trường tự nhiên. - Khả năng chống ăn mòn bởi các loại axit, đạt tiêu chuẩn Anh BS 680.', '2', 'Đa Lai Chau Lop Mai Mui Hai PJM-DLC0027', 'đá trang trí . đá ốp lát . đá slate ,đá chẻ ...', 0, '2018-08-20', '2018-08-20'),
