(81, 'Gạch Mosaic MST48058', 'gach-mosaic-mst48058', 45, 0, 'j1uR_48058-s-3631.jpg', 420000, 'Gạch Mosaic bể bơi MST48058\r\nSản phẩm gạch Mosaic Thủy Tinh được sản xuất bởi Công Ty Mosaic Việt Nam. Đây là nhà sản xuất hàng đầu về gạch bể bơi tại “Việt Nam”, sản phẩm có kích thước đồng đều, rất tự nhiên mang lại vẻ đẹp sang trọng quý phái mà chưa có dòng gạch mosaic bể bơi hiện nay có được. Sản phẩm được phân phối độc quyền tại Việt Nam PJM Company. \r\n\r\nKích thước : 300x300mm Kích thước viên : 47x47mm Tấm/m2 : 11.5 Tấm/hộp : 22', '2', 'MST48058', 'Mosaic be boi Mosaic kinh glass Mosaic Mosaic dep', 10, '2018-08-11', '2018-08-20'),
